import base64
from google.cloud import aiplatform
from google.oauth2.service_account import Credentials
from google.auth.transport.requests import Request
from PIL import Image
import io
import os

# Get the directory of the current script
current_dir = os.path.dirname(__file__)

# Construct the path to the key file relative to the current script
key_path = os.path.join(current_dir, '../AI_Model/lunar-parsec-417813-9b4958f8545d.json')

# Normalize the path
key_path = os.path.normpath(key_path)

def resize_image(image_data, max_size=(1024, 1024)):
    with Image.open(io.BytesIO(image_data)) as img:
        img.thumbnail(max_size)
        if img.mode == 'RGBA':
            img = img.convert('RGB')
        buffer = io.BytesIO()
        img.save(buffer, format="JPEG")
        return buffer.getvalue()

def predict_from_base64(
    base64_string: str,
    key_path=key_path,
    project: str = "372352180346",
    endpoint_id: str = "962774162722521088",
    location: str = "us-central1",
    api_endpoint: str = "us-central1-aiplatform.googleapis.com",
):

    os.environ["GOOGLE_APPLICATION_CREDENTIALS"] = key_path

    credentials = Credentials.from_service_account_file(key_path)

    if credentials.expired:
        credentials.refresh(Request())

    aiplatform.init(
        project=project,
        location=location,
        credentials=credentials
    )

    client_options = {"api_endpoint": api_endpoint}
    client = aiplatform.gapic.PredictionServiceClient(client_options=client_options)

    # Decode the base64 string
    file_content = base64.b64decode(base64_string)

    # Resize the image if necessary
    resized_content = resize_image(file_content)

    # Encode the content again in base64 as required by the prediction service
    encoded_content = base64.b64encode(resized_content).decode("utf-8")
    instance = aiplatform.gapic.schema.predict.instance.ImageClassificationPredictionInstance(
        content=encoded_content,
    ).to_value()
    instances = [instance]

    parameters = aiplatform.gapic.schema.predict.params.ImageClassificationPredictionParams(
        confidence_threshold=0.5,
        max_predictions=5,
    ).to_value()

    endpoint = client.endpoint_path(
        project=project, location=location, endpoint=endpoint_id
    )
    response = client.predict(
        endpoint=endpoint, instances=instances, parameters=parameters
    )

    print("response")
    print(" deployed_model_id:", response.deployed_model_id)

    predictions = response.predictions
    for prediction in predictions:
        print(" prediction:", dict(prediction))


# Example base64 string
base64_string=""

predict_from_base64(
    base64_string=base64_string
)

